Here is my analysis.
A THREAD

@drewhae Hanna’s Gourmet
2864 Adams Ave, San Diego, CA 92116
Literally EVERYTHING here is amazing. It’s currently only open on Sundays due to COVID, and they only offer curbside pickup but you can place an order days ahead. Family owned, and their dessert is also to die for.

@drewhae Carmen’s Mexican Food
4937 Diane Ave, San Diego, CA 92117

Family owned, fresh, no frills Mexican food. I always ask if they have any chile relleno left because they’re bomb and they run out quickly 👌🏽

@drewhae YOHED COFFEE
4160 University Ave, San Diego, CA 92105

It’s just a coffee shop so they only offer take-out, not delivery. Great Ethiopian coffee and baked goods, reasonably priced, family owned and super friendly :)
